  <div className="workContainer">
    <span className="artistName">
      {props.id}
      <img className="dumpHeart" src="/heart.svg" />
    </span>
    {props.children}
    <style jsx>{`
      .artistName {
        font-family: "Helvetica Neue", sans-serif;
        font-size: 0.8em;
        font-weight: 600;
        padding-right: 20px;
        margin-right: 10px;
        position: relative;
      }
      .dumpHeart {
        position: absolute;
        width: 8px;
        top: 40%;
        right: 8px;
        transform: translatey(-60%);
        transition: all 0.2s ease-in-out;
        cursor: pointer;
      }
      .dumpHeart:hover {
        width: 15px;
      }
      .workContainer {
      }
    `}</style>
  </div>
);
export default Dump;
